import styled from "styled-components";
import { FiActivity } from "react-icons/fi";

const Wrapper = styled.div`
  flex: 1;
  min-width: 100%;
`;

const getTrajectoryLength = ({ points }) => {
  const timeValues = Object.values(points).map(({ time }) => time);
  console.log(timeValues);
};

const Stats = ({ data }) => {
  console.log(data);
  getTrajectoryLength(data);

  return (
    <Wrapper>
      <h2>
        <FiActivity />
        <span className="mobile-hide">Did you know ?</span>
      </h2>
      <span>Durée d'un parcours:</span>
      <span>Durée d'un parcours:</span>
      <span>Durée d'un parcours:</span>
    </Wrapper>
  );
};

export default Stats;
